
CREATE TABLE IF NOT EXISTS amz.dim_stg_main_all_df(
    tenant_id STRING COMMENT '租户id',
    strategy_id STRING COMMENT '策略id（标签自由组合hashid)',
    strategy_name STRING COMMENT '策略名称',
    life_cycle_label STRING COMMENT '生命周期标签',
    goal_label STRING COMMENT '目标标签',
    ad_mode_label STRING COMMENT '投放类型标签',
    term_type_label STRING COMMENT '操作对象标签',
    stock_label STRING COMMENT '库存标签',
    norm_rank_label STRING COMMENT '自然坑位排名标签',
    click_label STRING COMMENT '点击标签',
    cvr_label STRING COMMENT '转化标签',
    adv_rank_label STRING COMMENT '广告坑位排名标签',
    relation_rank_label STRING COMMENT '关联广告坑位排名标签',
    sale_monopoly_label STRING COMMENT '垄断标签',
    flow_label STRING COMMENT '流量标签',
    cpc_label STRING COMMENT 'CPC标签',
    match_type_label STRING COMMENT '匹配类型标签',
    action_type STRING COMMENT '操作类型（前端页面类型展示名对应的英文）',
    action_name STRING COMMENT '操作名称（前端母表展示中文名）',
    strategy_execute_code STRING COMMENT '策略执行动作（后端操作标记名）',
    create_time timestamp COMMENT '创建时间',
    cpa_label STRING COMMENT 'cpa标签',
    acos_label STRING COMMENT 'acos标签',
    budget_label STRING COMMENT '预算标签',
    adv_period_label STRING COMMENT '广告时长标签',
    ctr_label STRING COMMENT 'CTR标签')
    STORED AS ORC
    TBLPROPERTIES ('comment'='广告策略(主表)');

